@classmethod
def combine(cls, styles: Iterable["Style"]) -> "Style":
    """Combine styles and get result.

    Args:
        styles (Iterable[Style]): Styles to combine.

    Returns:
        Style: A new style instance.
    """
    iter_styles = iter(styles)
    return sum(iter_styles, next(iter_styles))
